import React from "react";
import { Row, Col } from "antd";

export default function home() {
  return (
    <>
      <Row gutter={{ xs: 8, sm: 16, md: 24, lg: 32 }}>
        <Col>Home</Col>
        <Col>Our Food</Col>
        <Col>Plans</Col>
      </Row>
    </>
  );
}
